import React from "react";

export default function PageFooter() {
  return (
    <footer className="footer">
      <div>
        <h3>2021-2022</h3>
        <h2>Developer</h2>
        <h2>About</h2>
        <h2>Features</h2>
      </div>
    </footer>
  );
}
